function setCatThumbnails() {
    let thumbnailImages = document.querySelectorAll(".cover, .yt-core-image");
    thumbnailImages.forEach((element) =>{
        if(element.src !== "data:image/jpeg;base64,"){
            element.src = "data:image/jpeg;base64,";  
        }
    });
}

let interval = setInterval(setCatThumbnails,100);f